package com.vk2.touchsreentab.model;import com.vk2.touchsreentab.model.api.Album;import java.util.List;public class ResultAlbum {    private String msg;    private int err;    public String getMsg() {        return msg;    }    public void setMsg(String msg) {        this.msg = msg;    }    public int getErr() {        return err;    }    public void setErr(int err) {        this.err = err;    }    public List<Album> getData() {        return data;    }    public void setData(List<Album> data) {        this.data = data;    }    private List<Album> data;}